
# Single-file 1Doc branding (inline assets)
# Uso: no topo do seu app (v2), coloque:  import branding_inline as branding
# Requisitos: nenhum arquivo externo; tudo inline.

import base64, os
from pathlib import Path
import streamlit as st

APP_V2_URL = "https://1doc-geradortemplates.streamlit.app/"

# --- Imagens em base64 (geradas) ---
LOGO_B64 = ""
BG_B64 = ""

# --- Paleta ---
PRIMARY = "#0058D8"
PRIMARY_DARK = "#003F9E"
PRIMARY_LIGHT = "#E8F1FF"
ACCENT = "#00A8E8"

# escrever o ícone temporário para usar no page_icon
TMP_ICON = "/tmp/1doc_logo.png"
if not Path(TMP_ICON).exists():
    Path(TMP_ICON).write_bytes(base64.b64decode(LOGO_B64))

st.set_page_config(page_title="Gerador de Templates – 1Doc",
                   page_icon=TMP_ICON, layout="wide")

def inject_brand_css():
    st.markdown(f"""
    <style>
    .stApp {{
        background: url('data:image/jpg;base64,{BG_B64}') no-repeat center center fixed;
        background-size: cover;
    }}
    .stApp::before {{
        content: ""; position: fixed; inset: 0; background: rgba(255,255,255,0.70);
        pointer-events: none; z-index: 0;
    }}
    section.main > div {{ z-index: 1; }}
    .block-container {{ padding-top: 6rem; }}
    [data-testid="stSidebar"] > div:first-child {{
        background: rgba(255,255,255,0.90);
        backdrop-filter: blur(6px);
        border-right: 1px solid rgba(0,0,0,0.06);
    }}
    .brandbar {{
        position: fixed; z-index: 10; inset: 0 0 auto 0; height: 64px;
        background: linear-gradient(90deg, {PRIMARY} 0%, {PRIMARY_DARK} 100%);
        display:flex; align-items:center; gap:14px; padding: 0 20px;
        box-shadow: 0 4px 12px rgba(0,0,0,.08);
    }}
    .brandbar img {{ height: 32px; }}
    .brandbar .title {{ color: #fff; font-weight: 700; }}
    .badge, .btn-link {{
        display:inline-block; background: rgba(255,255,255,.18); color:#fff;
        padding:6px 10px; border-radius:9999px; font-size:.85rem; font-weight:600;
        border:1px solid rgba(255,255,255,.22); text-decoration:none;
    }}
    .btn-link.primary {{ background: {PRIMARY}; border-color: transparent; }}
    .stButton > button {{
        border-radius: 9999px; padding: 0.55rem 1rem; font-weight: 600;
        border: 1px solid rgba(0,0,0,0.06); box-shadow: 0 1px 3px rgba(0,0,0,.08);
    }}
    .stButton > button[kind="primary"] {{ background: {PRIMARY} !important; }}
    .stTextInput input, .stTextArea textarea, .stSelectbox > div > div, .stMultiSelect > div > div {{
        border-radius: 12px !important;
    }}
    .stTabs [data-baseweb="tab-list"] {{ gap: 6px; }}
    .stTabs [data-baseweb="tab"] {{
        background: {PRIMARY_LIGHT}; color: {PRIMARY_DARK}; border-radius: 9999px; padding: 8px 14px;
        border: 1px solid rgba(10,95,255,.12);
    }}
    .stProgress > div > div > div {{ background-color: {PRIMARY} !important; }}
    .stMetric label {{ color: {PRIMARY_DARK}; }}
    .stDataFrame [data-testid="stTable"] th {{ background: {PRIMARY_LIGHT}; }}
    footer, #MainMenu {{ visibility: hidden; }}
    </style>
    """, unsafe_allow_html=True)

def brand_header():
    st.markdown(f"""
    <div class="brandbar">
      <img src="data:image/png;base64,{LOGO_B64}" alt="1Doc logo"/>
      <div class="title">Gerador de Templates – 1Doc</div>
      <div style="flex:1"></div>
      <a class="badge" href="{APP_V2_URL}" target="_blank" rel="noopener">v2 • Abrir</a>
    </div>
    """, unsafe_allow_html=True)

brand_header()
inject_brand_css()

# Sidebar quick link
st.sidebar.markdown(
    f'<a class="btn-link primary" href="{APP_V2_URL}" target="_blank" rel="noopener">🔗 Abrir o app v2</a>',
    unsafe_allow_html=True
)
